import styled from '@emotion/styled';
import { motion } from 'framer-motion';

const AboutContainer = styled.div`
  padding: 120px 20px 60px;
  max-width: 1200px;
  margin: 0 auto;
`;

const AboutHeader = styled.div`
  text-align: center;
  margin-bottom: 60px;
`;

const Title = styled.h1`
  font-size: 48px;
  color: #FF6B35;
  margin-bottom: 20px;
`;

const Subtitle = styled.p`
  font-size: 18px;
  color: ${props => props.isDark ? '#ffffff' : '#666'};
  max-width: 600px;
  margin: 0 auto;
  line-height: 1.6;
`;

const Timeline = styled.div`
  position: relative;
  max-width: 800px;
  margin: 60px auto;
  padding: 40px 0;

  &::before {
    content: '';
    position: absolute;
    top: 0;
    left: 50%;
    width: 2px;
    height: 100%;
    background: #FF6B35;
    transform: translateX(-50%);
  }
`;

const TimelineItem = styled(motion.div)`
  display: flex;
  justify-content: ${props => props.position === 'right' ? 'flex-start' : 'flex-end'};
  padding-left: ${props => props.position === 'right' ? '50%' : '0'};
  padding-right: ${props => props.position === 'right' ? '0' : '50%'};
  margin-bottom: 40px;
  position: relative;
`;

const TimelineContent = styled.div`
  background: ${props => props.isDark ? '#1f1f1f' : 'white'};
  padding: 20px;
  border-radius: 8px;
  width: 80%;
  box-shadow: 0 4px 16px rgba(255, 107, 53, 0.1);
  position: relative;

  &::before {
    content: '';
    position: absolute;
    top: 20px;
    ${props => props.position === 'right' ? 'left: -10px' : 'right: -10px'};
    width: 20px;
    height: 20px;
    background: #FF6B35;
    border-radius: 50%;
  }
`;

const Year = styled.h3`
  color: #FF6B35;
  margin-bottom: 10px;
  font-size: 24px;
`;

const Description = styled.p`
  color: ${props => props.isDark ? '#ffffff' : '#333'};
  line-height: 1.6;
`;

const SkillsSection = styled.div`
  margin-top: 80px;
`;

const SkillsGrid = styled.div`
  display: grid;
  grid-template-columns: repeat(auto-fit, minmax(250px, 1fr));
  gap: 30px;
  margin-top: 40px;
`;

const SkillCard = styled(motion.div)`
  background: ${props => props.isDark ? '#1f1f1f' : 'white'};
  padding: 30px;
  border-radius: 12px;
  box-shadow: 0 4px 16px rgba(255, 107, 53, 0.1);
  text-align: center;
`;

const SkillIcon = styled.div`
  font-size: 40px;
  color: #FF6B35;
  margin-bottom: 20px;
`;

const SkillTitle = styled.h3`
  color: ${props => props.isDark ? '#ffffff' : '#333'};
  margin-bottom: 15px;
`;

const SkillDescription = styled.p`
  color: ${props => props.isDark ? '#cccccc' : '#666'};
  line-height: 1.6;
`;

function About({ isDark }) {
  const timelineData = [
    {
      year: '2023',
      description: 'Awarded Best Portrait Photographer of the Year'
    },
    {
      year: '2020',
      description: 'Opened my first photography studio'
    },
    {
      year: '2018',
      description: 'Started professional wedding photography'
    },
    {
      year: '2015',
      description: 'First international photography assignment'
    }
  ];

  const skills = [
    {
      icon: 'ðŸ“¸',
      title: 'Portrait Photography',
      description: 'Capturing personalities and emotions in every frame'
    },
    {
      icon: 'ðŸŽ¨',
      title: 'Photo Editing',
      description: 'Professional retouching and color grading'
    },
    {
      icon: 'ðŸŽ­',
      title: 'Event Coverage',
      description: 'Documenting special moments with attention to detail'
    },
    {
      icon: 'âœ¨',
      title: 'Creative Direction',
      description: 'Bringing creative visions to life through photography'
    }
  ];

  return (
    <AboutContainer>
      <AboutHeader>
        <Title>About Me</Title>
        <Subtitle isDark={isDark}>
          Passionate photographer with over 15 years of experience capturing life's precious moments
        </Subtitle>
      </AboutHeader>

      <Timeline>
        {timelineData.map((item, index) => (
          <TimelineItem
            key={item.year}
            position={index % 2 === 0 ? 'right' : 'left'}
            initial={{ opacity: 0, x: index % 2 === 0 ? 50 : -50 }}
            animate={{ opacity: 1, x: 0 }}
            transition={{ duration: 0.5, delay: index * 0.2 }}
          >
            <TimelineContent position={index % 2 === 0 ? 'right' : 'left'} isDark={isDark}>
              <Year>{item.year}</Year>
              <Description isDark={isDark}>{item.description}</Description>
            </TimelineContent>
          </TimelineItem>
        ))}
      </Timeline>

      <SkillsSection>
        <Title>My Skills</Title>
        <SkillsGrid>
          {skills.map((skill, index) => (
            <SkillCard
              key={skill.title}
              isDark={isDark}
              initial={{ opacity: 0, y: 20 }}
              animate={{ opacity: 1, y: 0 }}
              transition={{ duration: 0.5, delay: index * 0.1 }}
            >
              <SkillIcon>{skill.icon}</SkillIcon>
              <SkillTitle isDark={isDark}>{skill.title}</SkillTitle>
              <SkillDescription isDark={isDark}>{skill.description}</SkillDescription>
            </SkillCard>
          ))}
        </SkillsGrid>
      </SkillsSection>
    </AboutContainer>
  );
}

export default About;
